import React from 'react';
import Navigationvar from './Navigationvar';

export default function Home() {
  return (
    <div>
      <Navigationvar />
      <div className='block1'>
        <div className='content1'>
          <pre style={{ fontSize: '24px' }}>Enriching Lives Through Compassionate 
            In-Home Healthcare and Long-Term Facility 
            Senior Care</pre>
        </div>
        <div className='img1'>
          <img src='/istockphoto-1399124556-612x612.jpg' style={{ width:'50%', height: 'auto' }} />
        </div>
      </div>
    </div>
  );
}
